, 
[75116021] = {id = 75116021, remark = "自分の街で暴れまわっていたレッドが\nいたからというのもあるでしょうが…", type = 1, option_ids = "0", next = 75116022, role_ids = "75201002:75201005", expression = "0:exp_shock", action = "0:shock", action_type = "0", role_type = 75201005, position = "195:606:10000,642:606:10050", role_admission_type = "75201002:50:0,75201005:-50:0", role_departure_type = "75205005:0:0", scene_effect_position = "1:2", expression_position = "1:2", carmera = 51100001, carmera_time = 1, role_shake = "0", bgm = 1020003, effect_sound = 0, dialogue_sound = "Shanon_Plot_179"}
, 
